import axios from "axios";
import {useParams} from "react-router-dom";
export  function BuyNow(){
    const params = useParams()
    const getData = () =>{
        axios.get("http://localhost:9087/item/"+params.itemid)
            .then(response => {
                console.log(response)
                setCart(response.data)
            })
            .catch(err => {
                console.log(err)
            })
    }
    useEffect(()=>{
        getData()
    },[])
}
